    }

    this.isPendingPhone = true;
    $('#page_loading').css('display', 'block');
    this.authService.otpSubmit(this.sf.otp.value, 1, "", "").then(() => {
      this.phoneSubmitted = false;
      this.isPendingPhone = false;
      this.SignUpForm.reset();
      this.closePhonePop();
    });
